import React from 'react';
import Slide from './Slide';
import Buffet from './Buffet';
import Bruiloften from './Bruiloften';

export default class PageContent extends React.Component{
    render(){
        return(
            <div className="page-content-component">
                <div>
                    <Slide/>
                </div>
                <div class>
                    <div>
                        <Buffet/>
                    </div>
                    <div>
                        <Bruiloften/>
                    </div>
                </div>
            </div>
        )
    }
}
